import logo from "./logo.svg";
import { BrowserRouter, Routes, Route } from "react-router-dom";

import CounterOne from "./CounterOne";
// import SiteHeader from "./components/SiteHeader";
// import SiteFooter from "./components/SiteFooter";
import Layout from "./pages/Layout"
import Home from "./pages/Home";
import MintNFT from "./pages/MintNFT";;
import ConnectWallet from "./components/ConnectWallet";
import ContractCallVote from "./components/ContractCallVote";

function App() {
  return (
    <div className="App">
         <BrowserRouter>
          <Routes>
            <Route path="/" element={<Layout />}>
              <Route index element={<Home />} />
              <Route path="mint-nft" element={<MintNFT />} />
            </Route>
          </Routes>
        </BrowserRouter>

        {/* <SiteHeader />   */}
        {/* ConnectWallet file: `./src/components/ConnectWallet.js` */}
        <ConnectWallet />

        {/* ContractCallVote file: `./src/components/ContractCallVote.js` */}
        <ContractCallVote />

        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://docs.hiro.so/intro"
          rel="noopener noreferrer"
          target="_blank"
        >
          Learn Stacks
        </a>
        <a
            className="App-link"
            href="https://docs.hiro.so/build-apps/overview"
            rel="noopener noreferrer"
            target="_blank"
        >
          Learn to Build on Stacks
        </a>
        <a
          className="App-link"
          href="https://reactjs.org"
          rel="noopener noreferrer"
          target="_blank" 
        >
          Learn React
        </a>

        {/* <SiteFooter />   */}
    </div>
  );
}

export default App;
